import React from "react";

const Features = () => {
  return (
    <div className="features">
      <header>
        <h1>מקסמו את פוטנציאל המכירה</h1>
          </header>
          <h2>ניהול לידים</h2>
          <p></p>
    </div>
  );
};

export default Features;
